def change_history(history):
	to_be_deleted = []
	for event in history:
		event = history[event]
		event_type = event['type']
		event_id = event['id']
		if event_type == 'Answered':
			to_be_deleted.append(event_id)
	
	for event_id in to_be_deleted:
		del history[event_id]

	return history

